#pragma GCC optimize("O3")
#pragma GCC target("sse,sse2,sse3,ssse3,sse4,popcnt,abm,mmx,avx,avx2,fma")
#pragma GCC optimize("unroll-loops")

#include <bits/stdc++.h>
#include <malloc.h>
#include <ext/pb_ds/assoc_container.hpp>
#include <ext/pb_ds/tree_policy.hpp>

using namespace __gnu_pbds;
using namespace std;

#define pb push_back
#define all(x) x.begin(), x.end()
#define rall(x) x.rbegin(), x.rend()
#define input(v, n) for (int _ = 0; _ < n; _++) cin >> v[_]
#define print(v) for (auto& x : v) cout << x << ' '; cout << '\n'

typedef long long ll;
typedef unsigned long long ull;
typedef long double ld;

const int MAX_INT = 2147483647;
const double pi = acos(-1.0);
const int mod = 1e9 + 7;

mt19937_64 rng(chrono::steady_clock::now().time_since_epoch().count());

struct DSU {
    int n;
    vector<int> p, r, sz;
    vector<pair<pair<int, int>, pair<int, int>>> rb;

    DSU() {}

    DSU(int n): n(n) {
        new_version();
        p.resize(n);
        iota(all(p), 0);
        r.assign(n, 1);
    }

    void clear() {
        iota(all(p), 0);
        r.assign(n, 1);
    }

    int get(int a) {
        while (p[a] != a) a = p[a];
        return a;
    }

    bool unite(int a, int b) {
        a = get(a);
        b = get(b);

        if (a != b) {
            if (r[a] > r[b]) swap(a, b);
            rb.push_back(make_pair(make_pair(a, p[a]), make_pair(b, r[b])));
            r[b] += r[a];
            p[a] = b;
            return true;
        }
        return false;
    }

    void new_version() {
        sz.push_back(rb.size());
    }

    void rollback() {
        if (sz.size() == 1) return;

        sz.pop_back();
        while (rb.size() != sz.back()) {
            auto prev_p = rb.back().first, prev_r = rb.back().second;
            p[prev_p.first] = prev_p.second;
            r[prev_r.first] = prev_r.second;
            rb.pop_back(); 
        }
    }
};

struct edge {
    int l, r;
    pair<int, int> e;
    edge(int _l, int _r, pair<int, int> _e) : l(_l), r(_r), e(_e) {}
};

DSU dsu;
vector<int> ans;
vector<char> q;
vector<pair<int, int>> dc[1048576];
void add(int x, int l, int r, edge e) {
    if (e.l <= l && r <= e.r) {
        dc[x].push_back(e.e);
        return;
    }
    if (e.r <= l || r <= e.l) return;

    int m = (l + r) >> 1;
    add(2 * x + 1, l, m, e);
    add(2 * x + 2, m, r, e);
}
void solve(int x, int l, int r, int cnt) {
    if (l + 1 == r) {
        if (q[l] == '?') {
            dsu.new_version();
            for (auto e : dc[x]) {
                if (dsu.unite(e.first, e.second)) {
                    cnt--;
                }
            }
            ans.push_back(cnt);
            dsu.rollback();
        }
        return;
    }

    for (auto e : dc[x]) {
        if (dsu.unite(e.first, e.second)) {
            cnt--;
        }
    }
    dsu.new_version();

    int m = (l + r) >> 1;
    solve(2 * x + 1, l, m, cnt);
    solve(2 * x + 2, m, r, cnt);

    dsu.rollback();
}

signed main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);

    #ifndef ONPC
        freopen("connect.in", "r", stdin);
        freopen("connect.out", "w", stdout);
    #endif

    int n, k;
    cin >> n >> k;
    dsu = DSU(n);

    if (k == 0) return 0;

    map<pair<int, int>, int> last;
    vector<edge> e;
    for (int i = 0; i < k; i++) {
        char t;
        int u, v;
        cin >> t;
        q.push_back(t);
        if (t != '?') {
            cin >> u >> v;
            if (u > v) swap(u, v);
            pair<int, int> cur_edge = {u - 1, v - 1};
            if (t == '+') {
                last[cur_edge] = e.size();
                e.emplace_back(i, k, cur_edge);
            } else {
                e[last[cur_edge]].r = i;
            }
        }
    }

    
    for (auto edge : e) add(0, 0, k, edge);

    solve(0, 0, k, n);
    
    for (auto x : ans) cout << x << '\n';

    return 0;
}

