using namespace std;



void allmerge(int arr[],int lo,int hi){
     

     int mid =(lo+hi)/2;

     int n =mid-lo+1;//left 0to mid
     int m = hi-mid;//right all elemnts size

     int aa[n];
     int bb[m];
     
     int i=0,j=0,k;

     for(int i=0,j=lo;i<n;i++,j++){
          
          aa[i] = arr[j];


     }

     for(int i=0,j=mid+1;i<m;i++,j++){
         
         bb[i] = arr[j];
     }

       i=j=0;
       k=lo;
     while(i<n and j<m){
         
         if(aa[i]<bb[j]){
             
             arr[k] = aa[i];
             i++;
            
         }

         else{
             
             arr[k] = bb[j];

             
             j++;
         }

         k++;
     }

    ///4 5 6
     // 4 5  6
      //4  5    6
      while(i<n){
         
          arr[k] = aa[i];

          i++;
          k++;
      }

      while(j<m){
          
          arr[k] = bb[j];

          j++;
          k++;
      }

     return;

}

void mergeSort(int arr[],int l,int r){
     

      if(l>=r) return; //base case
      int mid = (l+r)/2;
      mergeSort(arr,l,mid);//left part 

      mergeSort(arr,mid+1,r);

      allmerge(arr,l,r); //orinal merge and combined

      return;
}

int main(){

     
    int arr[]={9,8,7,6,5,4,4,4};
    mergeSort(arr,0,7);
    for(auto a:arr){
    cout<<a<<" ";
    }



}

